import React from 'react';
import classes from "./Area.module.css";

const Area = () => {
    return (
        <div className= {classes.area}>
            <div className= {classes.areaText}>
                <div className= {classes.textBlock}>
                    <h1>Поиск и проверка работы заграницей</h1>
                    <p>Найдите работу заграницей, которая будет стоить вашего 
                    труда. Или оставьте свою анонимную оценку работодателям, с которыми имели дело.</p>
                    <button>Найти работу</button>
                    <button>Оставить отзыв</button>
                </div>
            </div>
        </div>
    );
}

export default Area;
